import React from 'react';
import { useHistory } from 'react-router-dom';
import "./Home.css";
import Footer from './Footer';

const Home = () => {

  const history = useHistory();

  const handleOrderClick = () => {
    history.push('/order-pizza');
  };

  return (
    <div>
      <header>
        <h1>Teknolojik Yemekler</h1>
        <p className='satisfy-text'>fırsatı kaçırma</p>
        <p className='text'>KOD ACIKTIRIR</p>
        <p className='text'>PİZZA DOYURUR</p>
        <button id="order" onClick={handleOrderClick}>ACIKTIM</button>
      </header>
      <div className='contents'>
        <div className='contents-container'>
          <div className='ozel'>
            <h1>Özel Lezzetus</h1>
            <p>Position Absolute Acı Pizza</p>
            <button id="order" onClick={handleOrderClick} style={{ background: "white", color: "#CE2829" }}>Sipariş Ver</button>
          </div>
          <div className='hackathlon-kurye'>
            <div className='hackathlon'>
              <h2>Hackathlon Burger Menü</h2>
              <button id="order" onClick={handleOrderClick} style={{ background: "white", color: "#CE2829" }}>Sipariş Ver</button>
            </div>
            <div className='kurye'>
              <h2 style={{paddingTop:"10%"}}>Çoooook</h2>
              <h2>hızlı npm gibi kurye</h2>
              <button id="order" onClick={handleOrderClick} style={{ background: "white", color: "#CE2829" }}>Sipariş Ver</button>
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default Home;
